import React from "react";
import './JoinRoom.css'
import { v1 as uuid } from "uuid";

const JoinRoom = (props) => {
    function create() {
        const id = uuid();
        props.history.push(`/room/${id}`);
    }

    return (
        <div className="joinRoom">
            <button onClick={ create }>
                Create room
            </button>
        </div>
    );
};

export default JoinRoom;
